The DOCKER_HOST configuration assumes users are running Colima, but this may not be the case for all Docker setups. Consider adding a note explaining when this configuration is needed or providing alternatives for different Docker installations.
```suggestion
            },
            // NOTE: The above DOCKER_HOST path is specific to Colima. 
            // If you are using Docker Desktop or another Docker installation, 
            // you may need to use a different socket path or omit DOCKER_HOST entirely.
            // For example:
            // - Docker Desktop (macOS): "DOCKER_HOST": "unix:///var/run/docker.sock"
            // - Docker Engine (Linux): "DOCKER_HOST": "unix:///var/run/docker.sock"
            // - Windows: Use the default TCP connection or configure as needed.
            // Adjust the DOCKER_HOST value according to your Docker setup.
```

Showing a placeholder token directly in the configuration example could encourage users to store tokens in plain text. Consider adding a warning about security implications or referencing the keychain storage section more prominently.
```suggestion
            "env": {
                // WARNING: Storing your GitHub token in plain text is insecure.
                // For secure storage, see the "Storing GitHub Token in Keychain" section below.
```

issue.body:
For the following MWE, `\test` is replicated to the CCMemo, but `\mytest` is not. 
```latex
\documentclass{article}
\usepackage{memoize}
\mmzset{prefix=memos/,
  auto=\test{replicate,args=,},
  auto=\mytest{replicate,args=,},
}
\def\test{test}
\begin{document}
\def\mytest{prawf}
\begin{memoize}
  abc
  \test
  \mytest
\end{memoize}
\end{document}
```
Memos:
```latex
\mmzResource{B9226F96A1F46D6457F3893AE2FF8330-E778DCCCB8AAB0BBD3F6CFEEFD2421F8.pdf}%
\mmzMemo 
\quitvmode \test \mmzIncludeExtern {0}\hbox {59.25pt}{7.05pt}{1.94pt}{72.26999pt}{72.26999pt}{7
2.26999pt}{72.26999pt}%
\mmzEndMemo 
```
```latex
\mmzMemo 
\global \mmzContextExtra {}%
%
\mmzSource 
abc \test \mytest 
```
The following shows that `\mytest` is not advised at all:
```latex
\documentclass{article}
\usepackage{memoize}
\mmzset{prefix=memos/,
  trace,
  auto=\test{replicate,args=,},
  auto=\mytest{replicate,args=,},
}
\def\test{test}
\begin{document}
\def\mytest{prawf}
\verb|\test|:\par\test\par \meaning\test\par
\verb|\mytest|:\par\mytest\par \meaning\mytest\par
Memoized:\par
\begin{memoize}
  \texttt{\textbackslash test}: \meaning\test
\end{memoize}

\begin{memoize}
  \texttt{\textbackslash test}: \test
\end{memoize}

\begin{memoize}
  \texttt{\textbackslash mytest}: \meaning\mytest
\end{memoize}

\begin{memoize}
  \texttt{\textbackslash mytest}: \mytest
\end{memoize}
\end{document}
```

I'm not sure if this is expected or not, but I cannot immediately see any straightforward workaround. If I use a custom `outer handler` with `auto`, for example, it is never invoked. 

This affects `expl3` variables, in particular, which may be declared in the preamble, but set only later. That is, it is common to have something like
```latex
\ExplSyntaxOn
\tl_new:N \g_test_tl
\ExplSyntaxOff
\begin{document}
...
<some function which sets \g_test_tl>
...
<use of \g_test_tl during memoization>
\end{document}
```
but then attempting to use `auto csname={g_test_tl}{...},` in the preamble fails.

