OK. I really should not have tried to translate this. I just knew you don't like `expl3`. 

The problem is that defined variables fail if they are empty. 
```latex
\documentclass{article}
\usepackage{memoize}
\ExplSyntaxOn
\tl_new:N \g_test_tl
\tl_new:N \g_prawf_tl
\newcommand\settest[1]{\tl_gset:Nn \g_test_tl {#1}}
\newcommand\printtest{\g_test_tl}
\newcommand\setprawf[1]{\tl_gset:Nn \g_prawf_tl {#1}}
\newcommand\printprawf{\g_prawf_tl}
\ExplSyntaxOff
\setprawf{fy mhrawf}
\mmzset{auto csname={g_test_tl}{replicate,args=}}
\mmzset{auto csname={g_prawf_tl}{replicate,args=}}
\begin{document}
\settest{my test}
\begin{memoize}
  \printtest
  \printprawf
\end{memoize}
\end{document}
```
Here both variables are defined, but only the one which non-empty when advised is replicated. 

However, I can't currently remember why I wanted to do this.
